import React, { Fragment } from "react";
import { MDBBtn } from "mdbreact";

const ButtonPage = () => {


  return (
    <Fragment>
      <MDBBtn outline color="primary">{this.props.title}</MDBBtn>
      <MDBBtn outline color="primary"></MDBBtn>

    </Fragment>
  );
}

export default ButtonPage;
